import React from 'react';
import Card from 'react-bootstrap/Card'

export default function RegisterRecordDetail(props){

    return(

        <React.Fragment>

            <Card className="detailCard">
                <Card.Header>
                    <h1>{props.selectedCourse && props.selectedCourse.courseName}</h1>
                </Card.Header>
            </Card>

        </React.Fragment>

    );

}
